import React from 'react';
import logo from './icons/logobk(2).png';
import './styles/Navigation.module.css';
import { Link } from 'react-router-dom';
// Icons import
import HomeRoundedIcon from '@mui/icons-material/HomeRounded';
import SearchRoundedIcon from '@mui/icons-material/SearchRounded';
import AddCircleOutlineRoundedIcon from '@mui/icons-material/AddCircleOutlineRounded';
import AccountCircleRoundedIcon from '@mui/icons-material/AccountCircleRounded';
import FavoriteBorderRoundedIcon from '@mui/icons-material/FavoriteBorderRounded';

const Navigation = () => {
  return (
    <>
      <div className="wrapper">
        <div className="wr" style={{ backgroundColor: 'black' }}>
          <img
            src={logo}
            alt="Logo"
            height="45"
            padding="20px"
            style={{ margin: '10px 0px 0px 10px' }}
          />
          <FavoriteBorderRoundedIcon style={{ color: 'black' }} />
        </div>
      </div>
      <ul>
        <li>
          <Link to={'/'}>
            <HomeRoundedIcon style={{ color: 'black' }} />
          </Link>
        </li>
        <li>
          <Link to={'/search'}>
            <SearchRoundedIcon style={{ color: 'black' }} />
          </Link>
        </li>
        <li>
          <Link to={'/upload'}>
            <AddCircleOutlineRoundedIcon style={{ color: 'black' }} />
          </Link>
        </li>
        <li>
          <Link to={'/account'}>
            <AccountCircleRoundedIcon style={{ color: 'black' }} />
          </Link>
        </li>
      </ul>
    </>
  );
};

export default Navigation;
